import React from "react";
import { Link } from "react-router-dom";

const styles = {
  container: {
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    background: "#f4f4f9",
    paddingTop: "60px",
  },
  title: {
    fontWeight: "bold",
    fontSize: "2.5rem",
    margin: "24px 0",
  },
  nav: {
    display: "flex",
    gap: "30px",
    margin: "24px 0",
  },
  link: {
    padding: "12px 24px",
    background: "#007bff",
    color: "white",
    borderRadius: "8px",
    textDecoration: "none",
    fontWeight: "bold",
    fontSize: "1.1rem"
  }
};

const Home = () => (
  <div style={styles.container}>
    <div style={styles.title}>Welcome to Banking System</div>
    <div style={styles.nav}>
      <Link to="/" style={styles.link}>Login</Link>
      <Link to="/signup" style={styles.link}>Signup</Link>
      <Link to="/dashboard" style={styles.link}>Dashboard</Link>
      <Link to="/transactions" style={styles.link}>Transactions</Link>
      <Link to="/forgot-password" style={styles.link}>Forgot Password</Link>
    </div>
  </div>
);

export default Home;
